style.css:
@-moz-document url("http://www.googlefeud.com/") {
#testdiv,
#testdiv2,
body,
input[type=text][disabled] {
    background-color: #222;
}
body {
    color: white
}
.caties,
.oval {
    font-weight: 700;
    background-color: #222;
}
#logo > path:nth-child(12),
#logo > path:nth-child(15),
#logo > path:nth-child(16),
#logo > path:nth-child(14),
#logo > path:nth-child(11),
#logo > path:nth-child(13) {
    fill: rgb(34, 34, 34)
}
input {
    background: rgb(44, 44, 44);
    color: white;
}
#table1 td,
#table2 td {
    border-top: rgb(54, 54, 54) solid;
    border-bottom: rgb(54, 54, 54) solid
}
#table1,
#table2 {
    border-collapse: collapse;
    border-left: thin rgb(54, 54, 54) solid;
    border-right: thin rgb(54, 54, 54) solid;
}
.otherthing a {
    text-decoration: none;
    color: lightgrey;
}
#querydiv {
    border: thin rgb(54, 54, 54) solid;
}
.caties {
    border: thin rgb(54, 54, 54) solid;
}
}
